INSERT INTO locales (id, def, base, en, de, it, fr, se, cz, br, sk, es, nl, ru, hr, fl) VALUES (131, 1, 'digitize_over', 'The new side overlaps another side of the polygon. \\nA polygon may not overlap itself.', 'Die neue Linie schneidet eine andere Seite des Polygons.\\nDie Seiten eines Polygons dürfen sich nicht überschneiden.', 'Il nuovo lato del poligono sovvrapone un''altro lato del poligono.\\nI lati di un poligono non possono sovvraponersi.', 'Le nouveau côté recouvre un autre côté du polygone. \\nLes côtés d''un polygone ne peut pas se recouvrir.', NULL, 'Nová linie se kříží s druhou stranou polygonu.\\nStrany polygonu se nesmějí křížit.', NULL, 'Nová línia sa kríži s druhou stranou polygónu.\\nStrany polygónu sa nesmú krížiť.', 'El nuevo lado recubre otro lado del polígono. \\nNo se pueden recubrir los lados de un polígono.', 'Over digitaliseren', 'Оцифровать заново', 'Nova strana poligona prekriva drugu stranu poligona.\\nStrane poligona se ne mogu prekrivati.', 'Over digitaliseren');
